// _app.js 는 모든 page 가 공통일 때 쓰입니다. 
/* eslint-disable react/react-in-jsx-scope */
import 'antd/dist/antd.css';
import PropTypes from 'prop-types';

const App = ({ Component }) => {
  return (
    <>
    <div>공통 메뉴</div>
    <Component />
    </>
  )
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
}

export default App;
